motion:
Shall SENATE CS FOR HOUSE BILL
NO. 19(STA) "An Act relating to special request registration plates;
and providing for an effective date" pass the Senate?

Shall SENATE BILL NO. 171 "An Act
increasing the base student allocation used for public school funding;
and providing for an effective date" pass the Senate?

Shall CS FOR SENATE BILL
NO. 175(L&C) am "An Act relating to the practice of naturopathy;
and providing for an effective date" pass the Senate?

Shall HOUSE BILL NO. 169 "An Act relating to
the review of proposed regulations by the Legislative Affairs Agency;
and providing for an effective date" pass the Senate?

Shall CS FOR SENATE BILL NO. 178(FIN)
"An Act relating to the passenger and recreational vehicle rental taxes;
and providing for an effective date" pass the Senate?

Shall CS FOR HOUSE BILL NO. 63(FIN) "An
Act relating to the Board of Governors of the Alaska Bar Association;
and providing for an effective date" pass the Senate?

Shall SENATE BILL NO. 135 "An Act
extending the termination date of the Alaska Health Care Commission;
and providing for an effective date" pass the Senate?
